import React from "react";
import "./Login.scss";

export const Login = () => {
  return (
    <div className="Login">
      <form className="Login__Form">
        <input placeholder="Email" className="Login__Form__Input"></input>
        <input
          placeholder="Mot de passe"
          className="Login__Form__Input"
        ></input>
      </form>
    </div>
  );
};

export default Login;
